import React, { useContext } from "react";
import Header from "../../Components/Header";
import Footer from "../../Components/Footer";
import SearchInput from "../../Components/SearchInput";
import { UserContext } from "../../Context/UserContext";
import "./favorites-page.scss";

const FavoritesPage = () => {
  const userContext = useContext(UserContext);
  const favorites = userContext?.favorites;
  return (
    <>
      <Header content="Logout" home="Home" />
      <div className="div-favorites-page">
        <h1>Your Favorites</h1>
        <SearchInput
          placeholder="Search by Name"
          onSearch={(value) => userContext?.handleSearch(value, "name")}
        />
        <SearchInput
          placeholder="Search by Species"
          onSearch={(value) => userContext?.handleSearch(value, "species")}
        />
        <StatusSelect
          onSearch={(value) => userContext?.handleSearch(value, "status")}
        />
        <GenderSelect
          onSearch={(value) => userContext?.handleSearch(value, "gender")}
        />
        {favorites?.map((char, i) => (
          <section key={i}>
            <h3>{char.name}</h3>
            <p>{char.species}</p>
            <img src={char.image} alt="" />
          </section>
        ))}
      </div>
      <Footer />
    </>
  );
};

export default FavoritesPage;
